import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';

import api from '../../services/api';

import './styles.css';

    
export default function Init(){
    const history = useHistory();
    const [name, setName] = useState('');
    const [description, setDescription] = useState('');
    const [city, setCity] = useState('');
    const [uf, setUf] = useState('');
    const [email, setEmail] = useState('');
    const [phone, setPhone] = useState('');
     
    
    async function handlePetshops(e){
        e.preventDefault();

        const dataPetshops = {
        name, description, city, uf, email, phone
       }
       try{
           await api.get('petshops', dataPetshops);
       }catch(err){
           
       }
       history.push('/init');
    }
    /*useEffect(() =>{
        api.get('inicial', {
            
        }).then(response =>{
            setPetshops(response.data);
        })
    }, []); */
    //{petshops.map(petshops => (
    return (
        <div classname="profile-container">
            
            <h1>Petshops Cadastrados</h1>
            <form onSubmit={handlePetshops}>
            <ul>
               
               <li>

                    <strong>NOME DO PETSHPOP:</strong>
                    <output value={name} onChange={e => setName(e.target.value)} />

                    <strong>DESCRIÇÃO:</strong>
                    <p value={description} onChange={e => setDescription(e.target.value)} />

                    <strong>CIDADE:</strong>
                    <p value={city} onChange={e => setCity(e.target.value)} />

                    <strong>UF:</strong>
                    <p value={uf} onChange={e => setUf(e.target.value)} />

                    <strong>EMAIL:</strong>
                    <p value={email} onChange={e => setEmail(e.target.value)} />

                    <strong>TELEFONE:</strong>
                    <p value={phone} onChange={e => setPhone(e.target.value)} />
                    
                </li>
            </ul>
            </form>
        </div>
    );
};
